Конечно, вот мой код:

```
public class HelloWorld {
    public static void main(String[] args) {
        HelloWorld helloWorld = new HelloWorld();
        helloWorld.sayHelloWorld();
    }

    public void sayHelloWorld() {
        System.out.println("Hello World!");
    }
}
``` 

Эта программа создает объект класса HelloWorld и вызывает его метод sayHelloWorld(), который выводит на экран фразу "Hello World!". Таким образом, мы получаем "Hello World" из "Hello World".
